column8:
沈下性の甲殻類専用飼料です。<br>
カルシウム強化でカラを丈夫にします。<br> 
ザリガニを初めとする甲殻類の必要とする栄養分をすべて含んでいますから、これだけで丈夫に飼うことができます。<br> 
ザリガニ・サワガニ・ヌマエビ・ヤドカリなどに。 <Br>
【与え方】<br>
1日2～3回、食べ残さないぐらいの量を与えて下さい。食べ残したエサはまめに取り除いてください。<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

