クマノミ、チョウチョ類をはじめとしたすべての海水魚に与えられるフレークフードです。<br><br>

●すべての海水魚用に開発されたフレークタイプのフードです。<br>
●海水魚の健全な成長と天然の美しい色彩を引き出すために必要な栄養成分をバランスよく配合しています。<br>
●シュリンプや海藻類を含んでいるので、嗜好性と色揚げ効果があります。<br> 
●テトラ独自の製法で、ビタミン強化されています。<br><br>
※1日3回数分で食べつくす量を与えてください。<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

