●稚魚の成長に合わせた2種類の顆粒。<br>
稚魚の口の大きさに合わせたエサを給餌することで、成長の効率に配慮しました。<br>
●マイクロバインディング製法<br>
稚魚が消化しやすいよう原料を一度ＥＰ粒に加工。これを微細に粉砕して極微量の強力なバインダーで粘結するマイクロバインディング製法を採用しました。水中に溶け出しにくく、一粒一粒に栄養成分が均一に含まれています。<br>
●稚魚の必須栄養素を全て配合。<br>
メチオニンをはじめ、稚魚の発育のためのに特別に必要な栄養素を全て含み、健全な成長をサポートします。<br><br>

<b>保証成分</b><br>
粗蛋白質：48％以上、粗脂肪：3.0％以上、粗繊維：2.0％以下、水分：10％以下、粗灰分：18％以上、リン：1.3％以上<br><br>
<img src="http://image.rakuten.co.jp/aquapet/cabinet/sonohokaguzu/01344805/img60390715.jpg" width="500" height="231" border="0"><br><br>

メーカー：キョーリン<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

