メダカの稚魚の健全な発育促進に。<br>
孵化後二日～三〇日までのベビーフード。<br>
※体長5～10mm<br><br>
●しばらく浮かんでゆっくり沈む消化吸収のよい小さな顆粒。<br>
●良質な原料を使用、成長から産卵までを支える栄養バランスに優れた餌。<br><br>

<b>栄養成分</b><br>
・粗タンパク質：49.0％以上<br>
・粗脂肪：11.0％以上<br>
・粗繊維：3.1％以下<br>
・粗灰分：15.0％以下<br>
・水分：10.0％以下<br>
・カルシウム：1.9％以上<br>
・リン：1.4％以上<br><br>
メーカー：スドー<br><!-- 帯バナー(RMSは共通説明文大に入ってる)-->

